import React from 'react';

export default function ContactPage() {
  return (
    <div className="min-h-screen bg-gray-50 py-20 px-6">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-6xl font-bold text-center text-gray-800 mb-12">Get in Touch</h1>
        <div className="bg-white rounded-3xl shadow-2xl p-10">
          <form className="space-y-8">
            <input type="text" placeholder="Your Name" className="w-full px-6 py-4 border border-gray-300 rounded-xl text-lg focus:outline-none focus:border-blue-500" />
            <input type="email" placeholder="Your Email" className="w-full px-6 py-4 border border-gray-300 rounded-xl text-lg focus:outline-none focus:border-blue-500" />
            <textarea placeholder="Your Message" rows={8} className="w-full px-6 py-4 border border-gray-300 rounded-xl text-lg focus:outline-none focus:border-blue-500"></textarea>
            <button className="w-full bg-blue-600 text-white py-5 rounded-xl text-xl font-bold hover:bg-blue-700 transition">
              Send Message
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}
